{
  "name": "UBX-HNR-PVT",
  "class_id": "0x28",
  "message_id": "0x00",
  "description": "High rate output of PVT solution",
  "message_type": "output",
  "payload": {
    "length": {
      "fixed": 72
    },
    "fields": [
      {
        "name": "iTOW",
        "byte_offset": 0,
        "data_type": "U4",
        "description": "GPS time of week of the navigation epoch.",
        "unit": "ms"
      },
      {
        "name": "year",
        "byte_offset": 4,
        "data_type": "U2",
        "description": "Year (UTC)",
        "unit": "y"
      },
      {
        "name": "month",
        "byte_offset": 6,
        "data_type": "U1",
        "description": "Month, range 1..12 (UTC)",
        "unit": "month"
      },
      {
        "name": "day",
        "byte_offset": 7,
        "data_type": "U1",
        "description": "Day of month, range 1..31 (UTC)",
        "unit": "d"
      },
      {
        "name": "hour",
        "byte_offset": 8,
        "data_type": "U1",
        "description": "Hour of day, range 0..23 (UTC)",
        "unit": "h"
      },
      {
        "name": "min",
        "byte_offset": 9,
        "data_type": "U1",
        "description": "Minute of hour, range 0..59 (UTC)",
        "unit": "min"
      },
      {
        "name": "sec",
        "byte_offset": 10,
        "data_type": "U1",
        "description": "Seconds of minute, range 0..60 (UTC)",
        "unit": "s"
      },
      {
        "name": "valid",
        "byte_offset": 11,
        "data_type": "X1",
        "description": "Validity Flags",
        "bitfield": {
          "bits": [
            {
              "name": "validDate",
              "bit_start": 0,
              "bit_end": 0,
              "description": "1 = Valid UTC Date"
            },
            {
              "name": "validTime",
              "bit_start": 1,
              "bit_end": 1,
              "description": "1 = Valid UTC Time of Day"
            },
            {
              "name": "fullyResolved",
              "bit_start": 2,
              "bit_end": 2,
              "description": "1 = UTC Time of Day has been fully resolved (no seconds uncertainty)"
            }
          ]
        }
      },
      {
        "name": "nano",
        "byte_offset": 12,
        "data_type": "I4",
        "description": "Fraction of second, range -1e9 .. 1e9 (UTC)",
        "unit": "ns"
      },
      {
        "name": "gpsFix",
        "byte_offset": 16,
        "data_type": "U1",
        "description": "GPSfix Type, range 0..5 (0x00 = No Fix, 0x01 = Dead Reckoning only, 0x02 = 2D-Fix, 0x03 = 3D-Fix, 0x04 = GPS + dead reckoning combined, 0x05 = Time only fix, 0x06..0xff: reserved)"
      },
      {
        "name": "flags",
        "byte_offset": 17,
        "data_type": "X1",
        "description": "Fix Status Flags",
        "bitfield": {
          "bits": [
            {
              "name": "GPSfixOK",
              "bit_start": 0,
              "bit_end": 0,
              "description": ">1 = Fix within limits (e.g. DOP & accuracy)"
            },
            {
              "name": "DiffSoln",
              "bit_start": 1,
              "bit_end": 1,
              "description": "1 = DGPS used"
            },
            {
              "name": "WKNSET",
              "bit_start": 2,
              "bit_end": 2,
              "description": "1 = Valid GPS week number"
            },
            {
              "name": "TOWSET",
              "bit_start": 3,
              "bit_end": 3,
              "description": "1 = Valid GPS time of week (iTOW & fTOW)"
            },
            {
              "name": "headVehValid",
              "bit_start": 4,
              "bit_end": 4,
              "description": "1 = Heading of vehicle is valid"
            }
          ]
        }
      },
      {
        "name": "reserved1",
        "byte_offset": 18,
        "data_type": {
          "array_of": "U1",
          "count": 2
        },
        "description": "Reserved",
        "reserved": true
      },
      {
        "name": "lon",
        "byte_offset": 20,
        "data_type": "I4",
        "description": "Longitude",
        "unit": "deg",
        "scale": {
          "raw": "1e-7",
          "multiplier": 1e-7
        }
      },
      {
        "name": "lat",
        "byte_offset": 24,
        "data_type": "I4",
        "description": "Latitude",
        "unit": "deg",
        "scale": {
          "raw": "1e-7",
          "multiplier": 1e-7
        }
      },
      {
        "name": "height",
        "byte_offset": 28,
        "data_type": "I4",
        "description": "Height above Ellipsoid",
        "unit": "mm"
      },
      {
        "name": "hMSL",
        "byte_offset": 32,
        "data_type": "I4",
        "description": "Height above mean sea level",
        "unit": "mm"
      },
      {
        "name": "gSpeed",
        "byte_offset": 36,
        "data_type": "I4",
        "description": "Ground Speed (2-D)",
        "unit": "mm/s"
      },
      {
        "name": "speed",
        "byte_offset": 40,
        "data_type": "I4",
        "description": "Speed (3-D)",
        "unit": "mm/s"
      },
      {
        "name": "headMot",
        "byte_offset": 44,
        "data_type": "I4",
        "description": "Heading of motion (2-D)",
        "unit": "deg",
        "scale": {
          "raw": "1e-5",
          "multiplier": 1e-5
        }
      },
      {
        "name": "headVeh",
        "byte_offset": 48,
        "data_type": "I4",
        "description": "Heading of vehicle (2-D)",
        "unit": "deg",
        "scale": {
          "raw": "1e-5",
          "multiplier": 1e-5
        }
      },
      {
        "name": "hAcc",
        "byte_offset": 52,
        "data_type": "U4",
        "description": "Horizontal accuracy",
        "unit": "mm"
      },
      {
        "name": "vAcc",
        "byte_offset": 56,
        "data_type": "U4",
        "description": "Vertical accuracy",
        "unit": "mm"
      },
      {
        "name": "sAcc",
        "byte_offset": 60,
        "data_type": "U4",
        "description": "Speed accuracy",
        "unit": "mm/s"
      },
      {
        "name": "headAcc",
        "byte_offset": 64,
        "data_type": "U4",
        "description": "Heading accuracy",
        "unit": "deg",
        "scale": {
          "raw": "1e-5",
          "multiplier": 1e-5
        }
      },
      {
        "name": "reserved2",
        "byte_offset": 68,
        "data_type": {
          "array_of": "U1",
          "count": 4
        },
        "description": "Reserved",
        "reserved": true
      }
    ]
  }
}

